import React from 'react';

import classes from './SliderSteps.module.css';
const Dots = ({ currentStep, onDotClick }) => {
	return (
		<>
			<div className={classes['steps-info']}>
				<div>
					<h3>Step {currentStep} of 5</h3>
				</div>

				<div className={classes['dots']}>
					<div
						onClick={onDotClick('1')}
						className={
							currentStep === '1'
								? `${classes.dot} ${classes.active}`
								: `${classes.dot}`
						}
					></div>
					<div
						onClick={onDotClick('2')}
						className={
							currentStep === '2'
								? `${classes.dot} ${classes.active}`
								: `${classes.dot}`
						}
					></div>
					<div
						onClick={onDotClick('3')}
						className={
							currentStep === '3'
								? `${classes.dot} ${classes.active}`
								: `${classes.dot}`
						}
					></div>
					<div
						onClick={onDotClick('4')}
						className={
							currentStep === '4'
								? `${classes.dot} ${classes.active}`
								: `${classes.dot}`
						}
					></div>
					<div
						onClick={onDotClick('5')}
						className={
							currentStep === '5'
								? `${classes.dot} ${classes.active}`
								: `${classes.dot}`
						}
					></div>
				</div>
			</div>
		</>
	);
};

export default Dots;
